<template>
   <div>
     <Button type="info" style="margin-bottom:10px;" @click="addNews">添加新闻</Button>
     <Table row-key="id" :columns="columns" :data="data" stripe border ></Table>
     <div style="margin: 10px;overflow: hidden">
       <div style="float: right;">
         <Page :total="total" :current="1" size="small" show-elevator show-sizer show-total @on-change="onPageChange" @on-page-size-change="onPageSizeChange"></Page>
       </div>
     </div>
     <!-- <img src="data:image/jpg;base64,/9j/4QMZR..." /> -->
     <NewsChange ref="NewsChange" @postNews='postNews' @putNews='putNews'></NewsChange>
   </div>
</template>

<script lang="ts">
import { Component, Prop, Vue } from 'vue-property-decorator';
import NewsChange from './model/News-change.vue';
import axios from 'axios';
import {Message} from 'view-design';
import {get,post,put,deletefn} from '@/api/axios';
@Component({
  components: {
    NewsChange,
  },
})

export default class News extends Vue {
  columns: Array<any> = [
    {
      title: '序号',
      key: 'id',
      align: 'center',
      width:50,
    },
    {
      title: '标题名称',
      key: 'title',
      align: 'center',
      width:200,
    },
    {
      title: '内容',
      key: 'content',
      align: 'center',
    },
    {
      title: '操作',
      align: 'center',
      width:150,
      render:(h:any,params: any)=> {
        return h('div', [
          h(
            'Button',
            {
              props: {
                type: 'info',
                size: 'small'
              },
              style: {
                marginRight: '5px',
                fontSize: '12px'
              },
              on: {
                click: () => {
                  (this.$refs.NewsChange as NewsChange).open();
                  (this.$refs.NewsChange as NewsChange).setInitNews('编辑新闻',params.row);
                }
              }
            },
            '编辑'
          ),
          h(
            'Button',
            {
              props: {
                type: 'error',
                size: 'small',
              },
              style: {
                marginRight: '5px',
                fontSize: '12px'
              },
              on: {
                click: () => {
                  // 删除分类，以id为判断标准，后端接受id查询后删除,再重新请求
                  this.deleteNews({_id:params.row._id})
                }
              }
            },
            '删除'
          )
        ])
      }
    }
  ]

  data: Array<any> = [
    {
      id:1,
      title:'为什么富士康和比亚迪要开始生产口罩？',
      content:'为什么很多大企业向富士康和比亚迪开始生产口罩？这里有以下四个方面原因：第一方面原因，口罩的需求非常大。随着突发事件的推进，管控措施已经达到了一定的时间，但社会必将要恢复正常，不可能长期处于管控状态，社会要逐步地恢复到流动状态，现在疫情并没有完全控制，传播的速度依然比较快，这就需要加大流动的防控力度，而戴口罩出门无疑是一个安全措施，但目前口罩的缺口非常大，一方面是需求旺盛的市场，一方面是货源的短缺，所以一些企业临时生产口罩，这是一个经营策略的选择。',
      picture:'data:image/jpeg;base64,'
    },
    {
      id:2,
      title:'为什么富士康和比亚迪要开始生产口罩？',
      content:'为什么很多大企业向富士康和比亚迪开始生产口罩？这里有以下四个方面原因：第一方面原因，口罩的需求非常大。随着突发事件的推进，管控措施已经达到了一定的时间，但社会必将要恢复正常，不可能长期处于管控状态，社会要逐步地恢复到流动状态，现在疫情并没有完全控制，传播的速度依然比较快，这就需要加大流动的防控力度，而戴口罩出门无疑是一个安全措施，但目前口罩的缺口非常大，一方面是需求旺盛的市场，一方面是货源的短缺，所以一些企业临时生产口罩，这是一个经营策略的选择。',
      picture:'https://images.pexels.com/photos/2929290/pexels-photo-2929290.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500'
    },
    {
      id:3,
      title:'为什么富士康和比亚迪要开始生产口罩？',
      content:'为什么很多大企业向富士康和比亚迪开始生产口罩？这里有以下四个方面原因：第一方面原因，口罩的需求非常大。随着突发事件的推进，管控措施已经达到了一定的时间，但社会必将要恢复正常，不可能长期处于管控状态，社会要逐步地恢复到流动状态，现在疫情并没有完全控制，传播的速度依然比较快，这就需要加大流动的防控力度，而戴口罩出门无疑是一个安全措施，但目前口罩的缺口非常大，一方面是需求旺盛的市场，一方面是货源的短缺，所以一些企业临时生产口罩，这是一个经营策略的选择。',
      picture:'https://images.pexels.com/photos/2929290/pexels-photo-2929290.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500'
    }
  ]

  // 要查询数据
  queryData: any = {
    page: 1,
    pageSize: 10
  };

  addNews(){
    // 添加商品分类
    (this.$refs.NewsChange as NewsChange).open();
    (this.$refs.NewsChange as NewsChange).setInitNews('添加新闻');
  }

  // 分页请求
  total:number=0;//总页数
  onPageChange(pageInfo: number) {
    this.queryData.page = pageInfo;
    this.getNews();
  }
  onPageSizeChange(newPageSize: number) {
    this.queryData.pageSize = newPageSize;
    this.getNews();
  }

  // 获取新闻api
  getNews(){
    const loading = this.$Loading;
    loading.start();
    get('http://127.0.0.1:3000/news/getnews',this.queryData)
    .then(res=>{
      this.data=(res as any).data;
      this.total=(res as any).total;
      this.data.forEach((item,index)=>{
        item.id=index+1;
      })
    })
    .catch(err => {
       this.$Message.error('加载失败'+err);
    })
    .finally(() => {
      loading.finish();
    });
  }
  // 新增新闻api
  postNews(row?:any){
    post('http://127.0.0.1:3000/news',row)
    .then(res=>{
      this.getNews();
    }).catch(err => {
       this.$Message.error('加载失败'+err);
    })
  }
  // 修改新闻api
  putNews(row?:any){
    put('http://127.0.0.1:3000/news',row)
    .then(res=>{
      this.getNews();
    }).catch(err => {
       this.$Message.error('加载失败'+err);
    })
  }
  // 删除商品api
  deleteNews(row?:any){
    deletefn('http://127.0.0.1:3000/news',{data:row})
    .then(res=>{
      this.getNews();
    }).catch(err => {
       this.$Message.error('加载失败'+err);
    })
  }

  created() {
    this.getNews()
  }
}
</script>

